```import subprocess
import time

urls = [
    "https://scoredata.me/chunks/1644c9d649cd40fea55eac85b19e21.mp4"
]

for idx, url in enumerate(urls, 1):
    filename = "video_{}.mp4".format(idx)
    print("Downloading video {}: {}".format(idx, url))
    start = time.time()
    try:
        result = subprocess.call(["wget", url, "-O", filename, "-q"])
        elapsed = time.time() - start
        if result == 0:
            print("Downloaded {} in {:.2f} seconds".format(filename, elapsed))
        else:
            print("Failed to download {} (wget error code {})".format(url, result))
    except Exception as e:
        print("Failed to download {}: {}".format(url, e))```
